import React, { useEffect, useState } from 'react';
import axios from 'axios';
import EmployeeProfile from './EmployeeProfile';
import { Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Avatar, Typography, TextField, Button, Box, Tooltip, InputAdornment, Divider } from '@mui/material';
import MaleIcon from '@mui/icons-material/Male';
import FemaleIcon from '@mui/icons-material/Female';
import InfoIcon from '@mui/icons-material/Info';
import PersonIcon from '@mui/icons-material/Person';
import SearchIcon from '@mui/icons-material/Search';


function EmployeeList({ onBack }) {
  const [employees, setEmployees] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [search, setSearch] = useState('');
  const [profileOpen, setProfileOpen] = useState(false);
  const [selectedEmployee, setSelectedEmployee] = useState(null);

  useEffect(() => {
    axios.get('http://localhost:5000/api/employees')
      .then(res => {
        setEmployees(res.data);
        setLoading(false);
      })
      .catch(err => {
        setError('Failed to fetch employees');
        setLoading(false);
      });
  }, []);

  const showProfile = (emp) => {
    setSelectedEmployee(emp);
    setProfileOpen(true);
  };

  const handleProfileClose = () => {
    setProfileOpen(false);
    setSelectedEmployee(null);
  };

  const handleProfileUpdate = (updatedEmp) => {
    setEmployees(prev => prev.map(emp => emp._id === updatedEmp._id ? updatedEmp : emp));
    setProfileOpen(false);
    setSelectedEmployee(null);
  };

  // Filter employees by NIC number only
  const filtered = employees.filter(emp =>
    emp.nicNumber && emp.nicNumber.toLowerCase().includes(search.toLowerCase())
  );

  if (loading) return <Typography align="center" sx={{ mt: 4 }}>Loading employees...</Typography>;
  if (error) return <Typography color="error" align="center" sx={{ mt: 4 }}>{error}</Typography>;

  return (
    <Box sx={{ p: 4 }}>
      <Typography variant="h4" sx={{ fontWeight: 700, color: '#1976d2', mb: 2 }}>EMPLOYEE SYSTEM</Typography>
      <Typography variant="h6" sx={{ fontWeight: 600, color: '#1976d2', mb: 2 }}>Employee List</Typography>
      <TextField
        variant="outlined"
        placeholder="Search by NIC number"
        value={search}
        onChange={e => setSearch(e.target.value)}
        sx={{ mb: 3, width: 320 }}
      />
      {filtered.length === 0 ? (
        <Typography color="text.secondary">No employees found.</Typography>
      ) : (
        <TableContainer component={Paper} sx={{ mt: 2 }}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Photo</TableCell>
                <TableCell>Full Name</TableCell>
                <TableCell>NIC Number</TableCell>
                <TableCell>Date of Birth</TableCell>
                <TableCell>Age</TableCell>
                <TableCell>Sex</TableCell>
                <TableCell>District</TableCell>
                <TableCell>Permanent Address</TableCell>
                <TableCell>Temporary Address</TableCell>
                <TableCell>Contact Details</TableCell>
                <TableCell>Profile</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {filtered.map(emp => (
                <TableRow key={emp._id}>
                  <TableCell>
                    {emp.photo ? (
                      <Avatar src={`data:image/*;base64,${emp.photo}`} alt={emp.fullName} />
                    ) : (
                      <Avatar><PersonIcon /></Avatar>
                    )}
                  </TableCell>
                  <TableCell>{emp.fullName}</TableCell>
                  <TableCell>{emp.nicNumber}</TableCell>
                  <TableCell>{new Date(emp.dateOfBirth).toLocaleDateString()}</TableCell>
                  <TableCell>{emp.age}</TableCell>
                  <TableCell>{emp.sex}</TableCell>
                  <TableCell>{emp.district}</TableCell>
                  <TableCell>{emp.permanentAddress}</TableCell>
                  <TableCell>{emp.temporaryAddress}</TableCell>
                  <TableCell>{emp.contactDetails}</TableCell>
                  <TableCell>
                    {!profileOpen && (
                      <Button variant="contained" color="primary" size="small" onClick={() => showProfile(emp)}>
                        <InfoIcon />
                      </Button>
                    )}
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      )}
      <EmployeeProfile
        open={profileOpen}
        onClose={handleProfileClose}
        employee={selectedEmployee}
        onUpdate={handleProfileUpdate}
      />
      {onBack && (
        <Button onClick={onBack} variant="contained" color="secondary" sx={{ mt: 4 }}>
          ‚Üê Home
        </Button>
      )}
    </Box>
  );
}

export default EmployeeList;
